jQuery(document).ready(function (l) {
  l('.featured-carousel').owlCarousel({
    loop: !0,
    margin: 10,
    navigation: !0,
    navigationText: [
      '<i class="fa fa-angle-left" aria-hidden="true"></i>',
      '<i class="fa fa-angle-right" aria-hidden="true"></i>',
    ],
    items: 4,
    itemsDesktop: [1200, 3],
    itemsDesktopSmall: [1024, 2],
    itemsTablet: [767, 1],
  }),
    l('[rel=popover]').popover({
      html: !0,
      placement: 'bottom',
      content: function () {
        return l('.savingsDetailsList').html();
      },
    }),
    jQuery('#mobile-menu-toggle').sidr({
      name: 'mobile-menu',
      side: 'right',
      onOpen: function () {
        l('.menu-top').animate(left, 200);
      },
      onClose: function () {
        l('.menu-top').animate(right, 200);
      },
    });
  var e = jQuery(window).height();
  l('.dealersnav ul.sub-menu').css('max-height', '400px'),
    e <= 600 && l('.dealersnav ul.sub-menu').css('max-height', '200px'),
    (isSmallMobile = {
      any: function () {
        return l(window).width() < 767;
      },
    }),
    l('[href="#"]').attr('href', 'javascript:void(0)'),
    isSmallMobile.any() &&
      (l('.gallery a.large-img').removeClass('fancybox'),
      l('#gallerycarousel')
        .find('a')
        .removeClass('fancybox')
        .click(function (e) {
          e.preventDefault(),
            l('.gallery').find('a.large-img').attr('href', l(this).attr('href')),
            l('.gallery').find('a.large-img img').attr('src', l(this).attr('href'));
        }),
      l('#gallerycarousel').touchwipe({
        wipeLeft: function () {
          l('#gallerycarousel').jcarousel('next'), jQuery('.carousel').tooltip('close');
        },
        wipeRight: function () {
          l('#gallerycarousel').jcarousel('prev'), jQuery('.carousel').tooltip('close');
        },
      }),
      l('.carousel').tooltip({
        content: 'Swipe Left/Right to Scroll Gallery!',
        position: { my: 'center', at: 'center' },
      })),
    (isVRP = {
      listview: function () {
        return !!l('.vehicle.list-view').length;
      },
      gridview: function () {
        return !!l('.vehicle.grid-view').length;
      },
      any: function () {
        return !!l('#results-page').length;
      },
    }),
    (isVDP = {
      wide1400: function () {
        return !!l('.maincardetails').length;
      },
      hotwheels: function () {
        return !!l('.project-hotwheels').length;
      },
      any: function () {
        return !!l('.vdpModals').length;
      },
    }),
    l('#vrp-custom-filter').click(function (e) {
      e.preventDefault(), l('.filter .mobile-tab-label').trigger('click');
    }),
    l('.specialCoupon .view-disclaimer-link').on('click', function (e) {
      var i = l(this).parents('.specialCoupon').find('.disclaimer');
      l(i).addClass('open');
    }),
    l('.specialCoupon .disclaimer .fa-close').on('click', function (e) {
      l(this).parents('.disclaimer').removeClass('open');
    }),
    l('body').on('homepage-usp-hidden', function () {
      l('#search-overlay .overlay-content').html('');
    }),
    l('a.scroll').click(function () {
      if (
        location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') &&
        location.hostname == this.hostname
      ) {
        var e = l(this.hash);
        if ((e = e.length ? e : l('[name=' + this.hash.slice(1) + ']')).length)
          return l('html,body').animate({ scrollTop: e.offset().top }, 1e3), !1;
      }
    }),
    isVDP.hotwheels() &&
      (l('body').on('click', '#ctabox-premium-features .features-link', function (e) {
        l('#factory_options .panel-title a').trigger('click');
      }),
      l('#mini-header').css('display', 'none'),
      l('.details-page-titlewrap .details-page-row').removeClass('no-spacer'),
      l('.cta-caption > p:first').insertAfter('.disclaimer-small > p:first'),
      l('.panel-title a')
        .not('.collapsed')
        .addClass('collapsed')
        .parents('.panel')
        .find('.panel-collapse')
        .removeClass('in'),
      l(window).resize()),
    l(window).width() < 768 && (isMobile.iOS() ? l('.fj-drive .android').hide() : l('.fj-drive .iOS').hide()),
    l('#footer, #videobanner, .menu-top').click(function () {
      l.sidr('close', 'mobile-menu');
    }),
    l('#ctabox-premium-features .features-link').click(function () {
      l(this).parent().toggleClass('open');
    }),
    0 == l('#count-number').html() && l('#vehicle-count-overview-number').hide(),
    jQuery('body').on('vrp-ajax-complete vrp-ready', function () {
      var e = l('.vehicle');
      l(e).each(function () {
        var e = l(this).find('#act-now-btn'),
          i = l(this).find('.act-now a'),
          t = l(this).find('#appraise-trade'),
          a = l(this).find('.appraise-trade a'),
          n = l(this).find('#get-eprice-cta'),
          o = l(this).find('.button-bar-item.primary-cta a');
        l(e).click(function () {
          l(i).click();
        }),
          l(t).click(function () {
            l(a).click();
          }),
          l(n).click(function () {
            l(o).click();
          });
      });
    }),
    (window.sr = ScrollReveal()),
    document.body.classList.contains('home') &&
      ((window.sr = ScrollReveal({
        duration: 1e3,
        scale: 1,
        origin: 'bottom',
        distance: '150px',
        easing: 'cubic-bezier(0.5, 1.10, 0.4, 1.19)',
        viewFactor: 0.65,
        mobile: !1,
      })),
      sr.reveal('.fly-in-left', { mobile: !1, origin: 'left', duration: 700, viewFactor: 0.65, distance: '150px' }),
      sr.reveal('.fly-in-right', { mobile: !1, origin: 'right', duration: 700, viewFactor: 0.65, distance: '150px' }),
      sr.reveal('.fly-in-bottom', {
        mobile: !1,
        origin: 'bottom',
        duration: 700,
        viewFactor: 0.65,
        distance: '150px',
      })),
    l('.lazy-loading').each(function (e) {
      var i = l(this);
      setTimeout(function () {
        i.addClass('active');
      }, 350 * e);
    });
});
